pragma solidity >=0.4.21 <0.6.0;

//交易所权限合约
contract ExchangeOwners {
    address public  contractOwner;                    //合约最高权限者
    mapping(address => bool) public accessAllowed;    //合约调用普通权限集合

    constructor () internal
    {
        contractOwner = msg.sender;
        accessAllowed[contractOwner] = true;
    }

    //给指定地址设置普通权限
    function setAccessAllow(address owner, bool access)
    public
    isContractOwner(msg.sender)
    {
        accessAllowed[owner] = access;
    }
    //设置最高权限地址
    function setContractOwner(address newAddr)
    public
    isContractOwner(msg.sender)
    {
        accessAllowed[contractOwner] = false;
        contractOwner = newAddr;
        accessAllowed[contractOwner] = true;
    }
    //判断是否拥有最高权限
    modifier isContractOwner(address addr)
    {
        require(contractOwner == addr, "ExchangeOwners:33");
        _;
    }
    //判断是否拥有普通权限
    modifier isOwners(address addr)
    {
        require(accessAllowed[addr], "ExchangeOwners:39");
        _;
    }

}
